var varRacename = getUrlVars()["racename"];
var varRaceyear = getUrlVars()["raceyear"];
var varRacetype = getUrlVars()["racetype"];
var varDataRow  = getUrlVars()["datarow"];
createPDFObject(0,varDataRow,0);

function createPDFObject(varStrPlace,varStrRow,varPrintCmd) {
	//印字文字列情報の取り込み
	var strJson         = document.getElementById('arrRacedata').textContent;
	var objJson         = JSON.parse(strJson);
	// 引数により、出力モードを変える。
	if (varStrPlace == 0) {
		var varTempRow  = varStrRow.replace(/[^0-9^]/g,"");
		var varIntRow   = parseInt(varTempRow,10);
		// Methodリダイレクトモード
		if (varIntRow > 0 && varIntRow < objJson.length + 1) {
			var tempPlace = objJson[varIntRow -1].strPlace
			var varIntX = varIntRow;
			if (isFinite(tempPlace)!=true){
				varPrintCmd = -1;
				alert("完走記録を確認できないため、出力ができませんでした。\n（DNS、DNF、OPEN等は正式な完走記録とはならないため、完走証の発行ができません。ご了承のほどよろしくお願いいたします。");
			}else{
				varPrintCmd = 1;
			}
		}else{
			var varIntX = -1;
			varPrintCmd = -2;
			alert("完走記録を確認できないため、出力ができませんでした。\n（情報出力時にエラーが発生しました。お手数ですが、大会主催者へお問い合わせ願います。");
		}
	}
	
	if (varStrRow == 0) {
		// HTML実行モード
		if (isFinite(varStrPlace)!=true){
			varPrintCmd = 0;
			var varIntX = -999;
			alert("完走記録として記録されていないため、出力ができませんでした。\n（DNS、DNF等は正式な完走記録とはならないため、完走証の発行ができません。ご了承のほどよろしくお願いいたします。");
		}else{
			varPrintCmd = 1;
			var varIntX = varStrPlace;
		}
	}
//	console.log('【createPDF関数の呼び出し(Row=' + varIntX + ')(Cmd=' + varPrintCmd + ')】　大会名称：' + varRacename + '   開催年： ' + varRaceyear + '   レースタイプ： ' + varRacetype + '   データ行番号：' + varIntX);

	if (varPrintCmd == 1) {
		alert("作成に1分程かかる場合があります。\nこのまま少々お待ちくださいませ。");
		//作成情報の検査
		var targetJson      = objJson[varIntX -1];
		var varRow          = targetJson.intRow;
		var varPlace        = targetJson.strPlace;
		var varResult       = targetJson.intResult;
		var varRaceNo       = targetJson.intRaceNo;
		var varPlayerName   = targetJson.strPlayerFullName.replace( / /g , "　" );
		var varTotalRecord  = targetJson.strTotalRecord.replace( /:/g , "+" );

		var varRow          = han2zen(varRow);
		var varPlace        = han2zen(varPlace);
		var varResult       = han2zen(varResult);
		var varRaceNo       = han2zen(varRaceNo);
		var varTotalRecord  = han2zen(varTotalRecord).replace( /＋/g , "：" );

		var doc = new jsPDF('p', 'pt', 'a4', false);
					doc.setDrawColor(0);
					doc.setFillColor(238, 238, 238);
					doc.rect(0, 0, 595.28,  841.89, 'F');
					doc.addImage(images_cert_edge, 'png', 0, 0, 595.28, 841.89, undefined, 'slow');
					doc.setFontSize(35);
					doc.text(244, 190, utf16_to_hexcode('完走証'));
					doc.setFontSize(22);
					doc.text(230, 220, utf16_to_hexcode('一般男子の部'));
					doc.setFontSize(16);
					doc.text(180, 240, utf16_to_hexcode('（スイム３００ｍ、ラン３．１ｋｍ）'));
					doc.setFontSize(18);
					doc.text(180, 320, utf16_to_hexcode('総合順位'));
					doc.text(315, 320, utf16_to_hexcode(varPlace));
					doc.text(400, 320, utf16_to_hexcode('位'));
					
					doc.text(180, 350, utf16_to_hexcode('レースナンバー'));
					doc.text(315, 350, utf16_to_hexcode(varRaceNo));
					doc.text(400, 350, utf16_to_hexcode('番'));

					doc.text(180, 380, utf16_to_hexcode('選手名'));
					doc.text(315, 380, utf16_to_hexcode(varPlayerName + '　殿'));

					doc.text(180, 410, utf16_to_hexcode('総合記録'));
					doc.text(315, 410, utf16_to_hexcode(varTotalRecord));

					doc.text(110, 500, utf16_to_hexcode('2016年めぐろさんまアクアスロン大会を'));
					doc.text(110, 530, utf16_to_hexcode('完走されましたので、上記の通り証明いたします。'));
					doc.text(140, 560, utf16_to_hexcode('平成28年　7月6日'));
					doc.text(170, 590, utf16_to_hexcode('目黒区トライアスロン連合　会長'));

					doc.save( '2016めぐろさんまアクアスロン完走証_' + varPlayerName.replace( /　/g , "" ) + '.pdf')
					
	}

}
